import React, {useState} from 'react';
import axios from 'axios';
import './css/ServerThumbnail.css';

function ServerThumbnail(props) {

    const clickedThumbnail = (e) => {
        props.changeServerCallback(props.serverId);
    }

    return(
        <div className="server-thumbnail-wrapper w-90 m-2 border border-secondary row" onClick={clickedThumbnail}>
            <div className="col my-auto">
                <img className="server-thumbnail-image" src={props.imageDataId ? `http://localhost:5000/files/image/${props.imageDataId}` : `${process.env.PUBLIC_URL}/images/server_default.png`}/>
            </div>
            <div className="server-thumbnail-name col my-auto">
                {props.serverName}
            </div>
        </div>

    );
}

export default ServerThumbnail;
